    private static final Pattern DATE_PATTERN =
            Pattern.compile("(\\w{3} \\d{2} \\d{4} \\d{2}:)([+\\-]\\d)");
    
    private static final DateTimeFormatter FORMATTER =
            new DateTimeFormatterBuilder()
                    .appendPattern("MMM dd yyyy HH:mmXXX")
                    .toFormatter();
    
    /**
     * 修正原始日期字符串格式：
     * 将 "Nov 10 2021 01: +0" → "Nov 10 2021 01:00+00:00"
     */
    public static LocalDateTime parseDateTime(String rawDateTime) {
        Matcher matcher = DATE_PATTERN.matcher(rawDateTime);
        if (matcher.find()) {
            String fixedDateTime = matcher.group(1) + "00" + matcher.group(2) + "00";
            return LocalDateTime.parse(fixedDateTime, FORMATTER);
        }
        throw new IllegalArgumentException("Invalid date format: " + rawDateTime);
    }
    
